import "../src/styles/styles.css";
import "../src/styles/bootstrap.min.css";

import Nav from "../src/component/nav";

export default function App({ Component, pageProps }) {
  return (
    <div>
      <Nav />
      <Component {...pageProps} />
    </div>
  );
}
